.container{
  height: calc(100vh - 45px);
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  flex-wrap: wrap;
  padding-top: 45px!important;
}

.container .hexagonArea{
  display: flex;
}

.container .hexagonArea.last{
transform: translateY(-45px);  
}

.container .hexagonArea .hexagon{
  position: relative;
  width: 200px;
  height: 240px;
  margin: 0 10px;
  clip-path: polygon(0 25%,50% 0,100% 25%,100% 75%,50% 100%,0 75%);
  background:radial-gradient(circle, rgba(20,191,152,.5) 0%, rgba(17,52,72,0.7) 90%);
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  color: white;
  cursor: pointer;
  transition: all 1s;
}

.container .hexagonArea .hexagon h3{
  text-transform: uppercase;
  font-weight: 600;
  margin-top: 10px;
  font-size: 17px;
  letter-spacing: 1px;
}

.container .hexagonArea .hexagon:hover
{
  background: transparent;
  transform: scale(.95);
}

